import "./index.css";
import HTML from ""

const Skills = () => {
  return (
    <>
      <div className="cotainer d-flex">
        <div class="card" style={{"width": "18rem"}}>
          <img src="" class="card-img-top" alt="..." />
          <div class="card-body">
            <div class="card-title">Card title</div>
            
          </div>
        </div>
      </div>
    </>
  );
};

export default Skills;
